Ousmane, een 60-jaar oude moslim uit Frankrijk, en mevrouw Sommers, een 55-jarige Engelse, die elkaar niet kennen, reizen vanuit hun respectievelijke woonplaatsen naar Londen. Dit naar aanleiding van de op dat moment (2005) net plaatsgevonden bomaanslagen op het openbaar vervoer in die stad. Hun kinderen worden namelijk vermist na deze aanslagen. Ze komen tot de ontdekking dat hun beide kinderen samenwoonden ten tijde van de aanslagen.

